The 'AddColumnOptions' in Abstract.cfc needs to be copied into the PostgreSQL.cfc and the following changed:

'''} else if(arguments.options.type == 'boolean') {
					arguments.sql = arguments.sql & " DEFAULT #IIf(arguments.options.default,1,0)#";'''

to

'''} else if(arguments.options.type == 'boolean') {
					arguments.sql = arguments.sql & " DEFAULT #IIf(arguments.options.default,de('true'),de('false'))#";'''

Made a start. Something doesn't quite work though. Execute in `/code`:

	use row\database\query\queryAND;
	use row\database\query\queryOR;

	$and1 = QueryAND::create('a = b', 'c > 2');

	$and2 = QueryAND::create('x < y', 'x > 10');

	$or = QueryOR::create($and1, $and2);

	echo $or->render($db);

It returns:

	((a = b AND c > 2) OR (a = b AND c > 2) OR (x < y AND x > 10) OR (x < y AND x > 10))

which is a little over the top =) It should return:

	(a = b AND c > 2) OR (a = b AND c > 2)

